TERMS-OF-USE.About-general-restriction-of-use:
Údaraíonn Wiin's duit leis seo an tSeirbhís a rochtain agus a úsáid, faoi réir na dtéarmaí seo a leanas a chomhlíonadh. Admhaíonn tú gur sárú ar na Téarmaí seo é do mhainneachtain aon cheann acu a chomhlíonadh:

10.1 Aontaíonn tú gan an Láithreán Gréasáin nó an tSeirbhís go léir, nó aon chuid díobh, lena n-áirítear an t-Ábhar, a dháileadh ar aon mheán, mura soláthraíonn Wiin's an modh chun an dáileadh sin a dhéanamh trí ghné a thairgtear mar chuid den tSeirbhís;

10.2 Aontaíonn tú gan aon chuid den láithreán gréasáin nó den tseirbhís a mhodhnú nó a athrú;

10.3 Aontaíonn tú gan rochtain a fháil ar an Ábhar ar bhealach ar bith seachas trí leathanaigh athsheinm físe an Láithreáin Gréasáin féin, seinnteoir Wiin nó aon bhealach eile a fhéadfaidh Wi-in a ainmniú go sainráite chun na críche seo;

10.4 Aontaíonn tú gan iarracht a dhéanamh aon ghné a bhaineann le slándáil na Seirbhíse a shárú, a dhíchumasú nó cur isteach air ar bhealach eile nó cosc a chur ar úsáid nó cóipeáil an Ábhair nó srian a chur air nó aon srianta a chur ar úsáid na Seirbhíse nó an Ábhar inrochtana ar an tSeirbhís;

10.5 Má úsáideann tú Imreoir an Wiin ar do shuíomh Gréasáin, ní fhéadfaidh tú aon fheidhmiúlacht Imreoir an Wiin a mhodhnú, saothar díorthach a chruthú, nó bac a chur air, lena n-áirítear aon naisc ar ais chuig an suíomh Gréasáin gan teorainn;

10.6 Aontaíonn tú gan aon chóras uathoibrithe a úsáid nó a sheoladh (lena n-áirítear, gan teorainn, aon róbat, damhán alla nó seinnteoir as líne) a bhfuil rochtain acu ar an tSeirbhís sa chaoi is go seolann sé níos mó teachtaireachtaí iarratais chuig freastalaithe Wiin i dtréimhse áirithe ama ná d’fhéadfadh duine táirgeadh go réasúnta sa tréimhse chéanna ama ag baint úsáide as brabhsálaí Idirlín caighdeánach (ie, gan athrú) atá ar fáil go tráchtála;

10.7 Aontaíonn tú gan aon sonraí pearsanta a bhailiú nó a fhómhar faoi aon úsáideoir ar an suíomh Gréasáin nó faoi aon seirbhís (agus admhaíonn tú go bhfuil ainmneacha cuntais Wiin san áireamh anseo);

10.8 Aontaíonn tú gan an Suíomh Gréasáin agus an tSeirbhís (lena n-áirítear na tuairimí agus na gnéithe ríomhphoist ar an Suíomh Gréasáin) a úsáid chun aon ghníomhaíocht tráchtála a lorg nó i dtaca le fiontar tráchtála;

10.9 Aontaíonn tú gan úsáideoirí an Láithreáin Ghréasáin a lorg chun críocha tráchtála maidir lena n-ábhar;

10.10 Aontaíonn tú gan rochtain a fháil ar an Ábhar chun aon chríche seachas úsáid neamhthráchtála pearsanta mar atá beartaithe agus ceadaithe ag gnáthfheidhmiúlacht na Seirbhíse agus chun críocha tarchur digiteach comhuaineach sonraí ar an Idirlíon amháin;

10.11 Ní dhéanfaidh tú aon Ábhar a chóipeáil, a atáirgeadh, a dháileadh, a tharchur, a chraoladh, a thaispeáint, a dhíol, a cheadúnú nó a shaothrú ar aon bhealach eile gan toiliú i scríbhinn roimh ré ó Wiiní nó ó cheadúnaithe an Ábhair faoi seach.
